import React from "react";
import { Routes, Route, BrowserRouter } from 'react-router-dom';
import Home from './routes/Home'
import Project from './routes/Project'
import { project } from './gql/Query'

function App() {
  return (
          <Routes>
            <Route path='/digital-portfolio-projects' element={<Home/>}/>
            <Route path='/project' element={<Project />}/>
            <Route path='/project/:id' element={<Project name={"Boolario"}/>} />
          </Routes>
  );
}

//Pages
//Layout - links
//Routing

export default App;
